import { Link } from 'react-router-dom';
import { ArrowRight, CloudOff, Image as ImageIcon, Zap } from 'lucide-react';

export default function Home() {
  return (
    <div className="space-y-12">
      <div className="text-center">
        <h1 className="text-4xl font-bold text-gray-900 sm:text-5xl md:text-6xl">
          AI-Powered De-Smoking & De-Hazing
        </h1>
        <p className="mt-3 max-w-md mx-auto text-base text-gray-500 sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
          Transform hazy and smoke-affected images into crystal clear visuals using our advanced AI algorithm.
        </p>
        <div className="mt-5 max-w-md mx-auto sm:flex sm:justify-center md:mt-8">
          <Link to="/upload" className="btn-primary flex items-center">
            Get Started 
            <ArrowRight className="ml-2 h-5 w-5" />
          </Link>
        </div>
      </div>

      <div className="grid grid-cols-1 gap-8 sm:grid-cols-2 lg:grid-cols-3">
        {[
          { icon: <ImageIcon className="h-10 w-10 text-indigo-600" />, title: "Upload Images", description: "Support for multiple image formats including JPG and PNG." },
          { icon: <CloudOff className="h-10 w-10 text-indigo-600" />, title: "Advanced Processing", description: "State-of-the-art U-Net and transformer-based processing." },
          { icon: <Zap className="h-10 w-10 text-indigo-600" />, title: "Instant Results", description: "Get processed images with detailed quality metrics." }
        ].map((feature, index) => (
          <div key={index} className="card flex items-center space-x-4">
            {feature.icon}
            <div className="flex-1 min-w-0">
              <h3 className="text-lg font-medium text-gray-900">{feature.title}</h3>
              <p className="text-sm text-gray-500">{feature.description}</p>
            </div>
          </div>
        ))}
      </div>

      <div className="bg-white rounded-lg shadow-sm border border-gray-200 overflow-hidden p-6">
        <h2 className="text-2xl font-bold text-gray-900">How It Works</h2>
        <div className="mt-6 grid gap-6 sm:grid-cols-2 lg:grid-cols-3">
          {[
            { step: "1. Image Upload", description: "Upload your hazy or smoke-affected images through our intuitive interface." },
            { step: "2. AI Processing", description: "Our AI model analyzes and processes your image using advanced algorithms." },
            { step: "3. Results", description: "Download your enhanced image with improved visibility and clarity." }
          ].map((item, index) => (
            <div key={index}>
              <h3 className="text-lg font-medium text-gray-900">{item.step}</h3>
              <p className="mt-2 text-gray-500">{item.description}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
